import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { InputValue } from 'src/InputValue';

@Injectable({
  providedIn: 'root'
})
export class ValueService {

  private baseUrl = 'http://localhost:8080/api/multiply'

  constructor(private http: HttpClient) { }

  getAllData(): Observable<any> {
    return this.http.get(`${this.baseUrl}/allData`)
 }

 addInputBy2(input: object): Observable<object> {
  return this.http.post(`${this.baseUrl}/calculate`, input);
}

addInputSquar(input: object): Observable<object> {
  return this.http.post(`${this.baseUrl}/square`, input);
}



multipliedSquare(value: InputValue): Observable<InputValue> {
  return this.http.post<InputValue>(`${this.baseUrl}/calculate`, value);
}

}
